import { Form, Container, Row, Col, Button, Figure } from "react-bootstrap";
import forgot_password from "../../assets/forgot password.svg";

const NotFoundPage = () => {
  return (
    <Container
      fluid
      style={{
        position: "absolute",
        top: "8%",
      }}
    >
      <Row>
        <Col sm={4} />
        <Col sm={4}>
          <Figure className="text-center ">
            <Figure.Image width={450} alt="none" src={forgot_password} />
          </Figure>
          <h1>Sorry, We haven't found this page.</h1>
          <h1> Please search for something else</h1>
        </Col>
        <Col sm={4} />
      </Row>
    </Container>
    // <div className="text-center">
    //   <h1>Sorry, We haven't found this page.</h1>
    //   <h1> Please search for something else</h1>
    // </div>
  );
};

export default NotFoundPage;
